package Switch_case;

public class Test {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i=10;
		switch(i)
		{
		case 5:
		{
			System.out.println("Five");
			break;
		}
		case 10:
		{
			System.out.println("ten");
			break;
		}
		case 15:
			System.out.println("Fifteen");
			break;
		}

	}

}
